import { createApp } from 'vue'
import App from './App.vue'
import {create} from 'naive-ui';
import router from './router'; 
import { createPinia } from 'pinia';

const naive = create();
const pinia = createPinia(); // 创建 Pinia 实例
const app = createApp(App);
app.use(naive);
app.use(router);
app.use(pinia);
app.mount('#app');


